#define MAX(a,b) ((a) > (b) ? a : b)
#define MIN(a,b) ((a) < (b) ? a : b)
using namespace std;

class Solution {
public:
    int findMaxLength(vector<int>& nums) {
        
        //Find the max possible substring
        int count = nums.size();
        int ones = std::accumulate(nums.begin(), nums.end(), 0);
        cout<<"count->"<<count<<" ,ones->"<<ones<<endl;
        int imin = min(ones,count-ones);
        int maxLen = 2* imin;
        cout<<"maxLen->"<<maxLen<<endl;
        if(count==maxLen)
            return count; 

        std::cout << '\n';
        vector<int> sums;
        //sums[0]=0;
        sums.push_back(0);
        for (size_t i = 1; i <= count; i++)
        {
           
            
            //sums[i]=(nums[i-1]==0)?sums[i-1]-nums[i-1]:sums[i-1]+nums[i-1];
            sums.push_back((nums[i-1]==0)?sums[i-1]-1:sums[i-1]+1);
            //sums.push_back((cnum!=0)?(sum+cnum):(sum-cnum));
        }
        
        for (auto n : sums)
            {
                cout<<n<<" -> ";
            }
        cout<<endl;
        int ans=0;
        for (int i = 0; i <= count; i++)
        {
            int start = sums[i];//check for this sum
            int max = min(maxLen + i ,count);
            for (size_t j = i+1; j <= max; j++)
            {
                if(start==sums[j])
                {
                    int len = j-i;
                    if(len>ans)
                        ans=len;
                }
            }
            
        }
        
        // for (auto n : nums)
        // {
        //     cout<<n<<" -> ";
        // }
         

        return ans;
    }
};

